      flexDirection: "row",
      flexWrap: "wrap"
    };
  };

  render() {
    return (
      <div className="container col-12 bg-light">
        <div class="row">
          {/* {this.props.heroes.map(hero => (
            <Hero hero={hero} styles={this.getStyle()} />
          ))}
          ; */}

          {Object.keys(this.props.heroes).forEach(function(key) {
            console.log(key, this.props.heroes[key]);
          })}
        </div>
      </div>
    );
  }
}

